import React from "react";

import SimpleSlider from "../../Shared/PhotoSlider/SimpleSlider";
import {
  PhotoConteiner,
  SimpleSliderConteiner,
  BtnDesktop,
  VectorTop,
  MainConteiner,
  InfoConteiner,
  CompanyName,
  CompanyInfo,
} from "./style";

import { Icon } from "../../Shared/svg/Icon";
import styled from "styled-components";

const Vector = styled.hr`
  border-color: red;
  height: 3px;
`;

export default function PersonPage() {
  return (
    <MainConteiner>
      <PhotoConteiner>
        <SimpleSliderConteiner>
          <SimpleSlider />
        </SimpleSliderConteiner>
        <BtnDesktop></BtnDesktop>
      </PhotoConteiner>
      <InfoConteiner>
        <Icon id="man" className="man" />
        <VectorTop />
        <CompanyName>asdasd</CompanyName>
        <CompanyInfo>asdasd</CompanyInfo>
        <Vector />
      </InfoConteiner>
    </MainConteiner>
  );
}
